import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import ClientList from './components/ClientList';
import ClientFilter from './components/ClientFilter';
import ClientForm from './components/ClientForm';
import CalcRota from './components/CalcRota';
import { Nav, Navbar, Container } from 'react-bootstrap';

function App() {
 return (
    <Router>
      <div className="App">
      <Navbar bg="light" expand="lg">
          <Container>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto">
                <Nav.Link as={Link} to="/client-form">Client Form</Nav.Link>
                <Nav.Link as={Link} to="/client-filter">Client Filter</Nav.Link>
                <Nav.Link as={Link} to="/client-list">Client List</Nav.Link>
                <Nav.Link as={Link} to="/calc-rota">Calc Rota</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>

        <Routes>
          <Route path="/client-form" element={<ClientForm />} />
          <Route path="/client-filter" element={<ClientFilter />} />
          <Route path="/client-list" element={<ClientList />} />
          <Route path="/calc-rota" element={<CalcRota />} />
        </Routes>
      </div>
    </Router>
 );
}

export default App;
